import React from 'react';
import { Typography, Link } from '@mui/material';
import { styled } from '@mui/system';

const FooterContainer = styled('footer')({
  backgroundColor: '#333',
  color: '#fff',
  padding: '20px',
  textAlign: 'center',
  position: 'relative',
  bottom: 0,
  width: '100%',
  overflow: 'hidden',
});

const Footer = () => {
  return (
    <FooterContainer>
      <Typography variant="body1">
        © {new Date().getFullYear()} Júlio Gonçalves.
        <br></br> All rights reserved.
      </Typography>
      <Typography variant="body2">
        Built with <Link href="https://reactjs.org/" underline="hover" target="_blank" rel="noopener noreferrer">React</Link> and <Link href="https://mui.com/" underline="hover" target="_blank" rel="noopener noreferrer">Material-UI</Link>.
      </Typography>
    </FooterContainer>
  );
};

export default Footer;
